    TResult? Function(LoginInProgress value)? loginInProgress,
    TResult? Function(LoginSuccess value)? loginSuccess,
    TResult? Function(LoginFailed value)? loginFailed,
  }) {
    return loginFailed?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(IsLoginState value)? isLoginState,
    TResult Function(NotLoginState value)? notLoginState,
    TResult Function(InitState value)? initState,
    TResult Function(LoginInProgress value)? loginInProgress,
    TResult Function(LoginSuccess value)? loginSuccess,
    TResult Function(LoginFailed value)? loginFailed,
    required TResult orElse(),
  }) {
    if (loginFailed != null) {
      return loginFailed(this);
    }
    return orElse();
  }
}

abstract class LoginFailed implements LoginState {
  const factory LoginFailed({final String? error}) = _$LoginFailed;

  String? get error;
  @JsonKey(ignore: true)
  _$$LoginFailedCopyWith<_$LoginFailed> get copyWith =>
      throw _privateConstructorUsedError;
}
